import { Route, Router, Switch } from "react-router";
import App from "./App";
import Home from "./pages/Home";


function Routes() {
  return(
      <>
        <Router>
          <Switch>
            <Route path="/" exact component={Home} />
          </Switch>
        </Router>
      </>
  );
}

export default Routes;
